style.css:
@-moz-document domain('beta.bloglines.com') {
   div.fullviewTemplate, div.templateBody {
      background-color: #666 !important;
      border: 1px solid #999 !important;
   }
   div.templateBody ul.nav_itemlinks, div.templateBody ul.nav_itemlinks li ul, #bottomContent ul.nav_itemlinks, #bottomContent ul.nav_itemlinks , #right-pane, #container, #left-pane, #feedtreeBody, #savedTreeBody {
      background-color: #666;
   }
   .tree li.root {
      border-color: transparent;
   }
   .tree a:link, .tree a:visited {
      color: #333;
   }
}
